import React from 'react';
import LccLinkTile from './LccLinkTile';

export default class Categories extends React.Component {
  render() {
    const myArray = {

  };
  return(

      <>

        <div class="text">
          <h1>On-line Services</h1>
        </div>

        <div class="groupPromo">
          <div class="listWebpart">
            <ul>
              {
                myArray.forEach(element => {
                  <li>
                    <LccLinkTile to={element.to} header={element.header} description={element.description} />
                  </li>
                })
              }
              <li>
                <LccLinkTile to="/ContactUsPathways/Description" header="Contact Us Pathways" />
              </li>
              <li>
                <LccLinkTile to="/CRM/Search" header="Search" description="Search service requests by reference number" />
              </li>
              <li>
                <LccLinkTile to="/RoadsAndTraffic" header="Roads and traffic" />
              </li>
              <li>
                <LccLinkTile to="/BinsRecyclingAndUnwantedItems" header="Bin collections, recycling and unwanted items" />
              </li>
              <li>
                <LccLinkTile to="/Streets" header="Clean and clear streets" />
              </li>
              <li>
                <LccLinkTile to="/DogsAndPest" header="Dogs and pest control" />
              </li>
              <li>
                <LccLinkTile to="/Properties" header="Issues with commercial and residential properties" />
              </li>
              <li>
                <LccLinkTile to="/HealthAndSafety" header="Health and safety" />
              </li>
              <li>
                <LccLinkTile to="/AntiSocialbehaviourAndNoise" header="Antisocial behavior and noise nuisance" />
              </li>
              <li>
                <LccLinkTile to="/CouncilTax" header="Council tax" />
              </li>


            </ul>
          </div>
        </div>
      </>
    );
  }
}

class LinkData {
  constructor(to, header, description) {
    this.state = {
      brand: "Ford",
      model: "Mustang",
      color: "red",
      year: 1964
    };
  }
}
